import React from "react";
import "./2fa.css";
import { useNavigate } from "react-router-dom";


export const TwoFA = () => {
  const navigate = useNavigate;
  const handleSubmit = (event) => {
    event.preventDefault();
  };
  return (
    <div className="twofa-container">
      <div className="twofa-form">
        <h1>2-Factor Authentication</h1>
        <p>Verify your account.</p>
        <p>Enter the code you recieved.</p>
        
        <form onSubmit={handleSubmit} className='content-area'>
        <h4>Verify Login Code</h4>
        <h5>Welcome Back!</h5>

        <fieldset className='number-code'>
          <legend>Security Code</legend>
          <div>
            <input name='code' className='code-input' required />
            <input name='code' className='code-input' required />
            <input name='code' className='code-input' required />
            <input name='code' className='code-input' required />
            <input name='code' className='code-input' required />
            <input name='code' className='code-input' required />
          </div>
        </fieldset>
        <p>
          <a href='#'>Resend Code</a>
        </p>
        <input type='submit' value='Submit' />
      </form>
        
        <a href="/login" className="back-to-login">Back to Login</a>
      </div>
    </div>
  );
};

export default TwoFA;
